import axios from 'axios'
const base = "https://localhost:7263/api/v1/"
export default {
    _function: getAll(link),
    get function() {
        axios.get(`${base}${link}`)
        .then((res) => {
            return res
        })
        .catch(res => {
            return res
        })
    },
    set function(value) {
        this._function = value
    },
}
